import time
def minion_game(s):
    vowel={'A', 'E', 'I', 'O', 'U'}
    s=s.upper();
    stuart=0
    kevin=0
    length=len(s)
    for x in range(0, length):

            # if (s[x:y][0] in vowel):
        if (s[x] in vowel):
            kevin=kevin+(length-x)

        else:
            stuart=stuart+(length-x)
            # print(str(stuart)+"  "+s[x+1])
            # if (s[x] in vowel):
            #     kevin=kevin+1
            # else:
            #     stuart=stuart+1

    # print("stuart "+str(stuart)+ ",  kevin "+str(kevin))
    if (kevin>stuart):
        return "Kevin "+str(kevin)
    elif (kevin<stuart):
        return "Stuart "+str(stuart)
    else:
        return "Draw"

